INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("", 91002, 36, 0, 0, 8, "", 40000, 0, 100, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("ぺコリーヌ", 91002, 37, 0, 107501, 8, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 40001, 1, 150, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("コッコロ", 91002, 38, 0, 107601, 8, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 40001, 1, 150, 2);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("キャル", 91002, 39, 0, 107801, 8, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 40001, 1, 150, 3);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("スズメ", 91002, 40, 0, 107701, 8, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 40001, 1, 150, 4);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("タマキ", 91002, 41, 0, 107901, 8, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 40001, 1, 150, 5);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("ぺコリーヌ", 91002, 42, 0, 107501, 8, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 40001, 2, 150, 6);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("コッコロ", 91002, 43, 0, 107601, 8, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 40001, 2, 150, 7);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("キャル", 91002, 44, 0, 107801, 8, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 40001, 2, 150, 8);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("スズメ", 91002, 45, 0, 107701, 8, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 40001, 2, 150, 9);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("タマキ", 91002, 46, 0, 107901, 8, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 40001, 2, 150, 10);
