INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("リリ", 24001, 321, 0, 125801, 2, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 40011, 1, 1, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("クリア", 24001, 322, 0, 126001, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 40011, 1, 1, 2);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("プレシア", 24001, 323, 0, 126101, 2, "んーと。\nこれ、あげる。\nはい", 40011, 1, 1, 3);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("リリ", 24001, 324, 0, 125801, 2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 40011, 2, 1, 4);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("クリア", 24001, 325, 0, 126001, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 40011, 2, 1, 5);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("プレシア", 24001, 326, 0, 126101, 2, "お兄。\nきてくれて、うれしい", 40011, 2, 1, 6);
